import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <Router>
    <Routes>
      <Route path='/' element={<Home />} />      (//this line used by layout.)
      <Route path='/myapps' element={<Gymform />} /> (//this line are type the url search bar)
      <Route path='/learn' element={<Learn />} />  (.//this are components)

    </Routes>
  </Router>
);
function Home() {
  return (
    <div>
      <h1>Home route </h1>
    </div>
  )
}

function Learn() {
  return (
    <div>
      <h1>Learn </h1>
      <h4>All Courses are needed here</h4>
    </div>
  )
}
reportWebVitals();
